import React from 'react';


function Avatar(size){
    return(
        <img 
        className="avatar"
        src="https://i.imgur.com/1bX5QH6.jpg"
        alt='person alia'
        width={size}
        height={size}
        />
    );
}

export default function Profile(){
    return(
        <div>
            <Avatar 
             size = {100}
            />
            <Avatar 
             size = {90}
            />
            <Avatar 
             size = {70}
            />
        </div>
    );
}
